      var len = endx - startx;
      var rem = len % 5;
      var steps = Math.floor(len / 5);

      if (rem >= 3) {
        steps++;
      }

      steps--;
      var str = "";
      var x = startx;
      var i = 0;

      for (i = 0; i < steps; i++) {
        if (i % 2 == 0) str += "L " + (x + 2.5) + " 0 ";else str += "L " + (x + 2.5) + " 5 ";
